description:
Freja är mycket mer än en traditionell e-legitimation. Med Freja kan du komma åt e-tjänster, bevisa din identitet och ålder med det digitala ID-kortet, dela din identitet med andra online och kontrollera hur dina uppgifter delas med en säker statligt godkänd app.

UPPTÄCK FREJA

De funktioner som väntar på dig i Freja är:

SNABB OCH SÄKER INLOGGNING
Kom åt anslutna e-tjänster i Sverige;
Inloggning med QR-kod;
Godkänn med biometri, helt utan lösenord.
DIGITALT ID-KORT
Används precis som ett fysiskt ID;
Bevisa din identitet och ålder i vardagssituationer;
Fler och fler ställen i Sverige tar emot Freja som alternativ till fysiskt ID-kort.
PEER-2-PEER IDENTIFIERING
Bevisa din identitet och identifiera andra;
Dela ditt ID med andra via en länk i ett meddelande;
Identifiera andra genom att skanna deras Freja eller ta emot en länk.
ID-SKYDD
En kostnadsfri funktion inbyggd i Freja;
Meddelas om någon skulle ändra din folkbokföringsadress;
Detta ger dig tid att agera för att förhindra eventuell ID-kapning.
DIGITAL SIGNERING
Freja erbjuder juridiskt bindande digitala underskrifter;
Signera avtal eller ge samtycke digitalt.
ORGANISATIONS ID
Freja kan särhålla din personliga och tjänstebaserade e-legitimation.;
Freja är även en lösning för temporära eller delade enheter som används av en arbetsplats i en pool.
SÖMLÖS ÖVERFÖRING OCH FLEXIBILITET
Den digitala aspekten av Freja möjliggör oerhörd flexibilitet i användandet;
För enkelt över ditt Freja till en ny enhet när du byter mobil;
Koppla upp till tre e-postadresser och/eller tre mobilnummer till ditt konto.
TILLGÄNGLIGT FÖR ALLA
Utlandssvenskar kan skaffa Freja;
Personer med styrkta samordningsnummer kan skaffa Freja;
Personer med skyddad identitet kan skaffa Freja;
Med "Delad Kontroll" kan du ansluta ditt konto till och hjälpa en annan person med deras användning av Freja.
MINA SIDOR
Se anslutna tjänster och aktivera/inaktivera dem;
Se exakt vilka uppgifter du delat, till vem och när;
Lägg till användarnamn – e-postadresser och telefonnummer;
Hantera anslutna enheter;
Se din transaktionshistorik.
FULL KONTROL OVER DINA UPPGIFTER

Freja är en statligt godkänd lösning. Detta innebär att vi uppfyller samtliga regulatoriska krav avseende personuppgifter inklusive GDPR. När det gäller dina personuppgifter kan du alltid:

Se exakt vilka uppgifter du delar med en tjänst;
Se alla transaktioner du påbörjat i Mina Sidor;
Kontrollera vilka tjänster som är aktiverade/inaktiverade för ditt personnummer.
HUR DU SKAFFAR FREJA

Att registrera sig för Freja är enkelt och du kan göra det på bara några få steg.

SKAPA KONTO
Verifiera din e-post
Skapa en PIN-kod
BYGG DIN E-LEGITIMATION
Ta ett ID-foto
Lägg till en giltig ID-handling
Vid denna punkt behöver vårt säkerhetsteam verifiera din identitet. Detta tar normalt sett bara ett par minuter under arbetsdagar, men kan ta längre tid under nätter och helger. Vi meddelar dig så snart kontrollen är klar.

SKAFFA FREJA eID+
Den högsta säkerhetsnivån i Freja
Du behöver bara besöka ett av våra ombud för en snabb fysisk kontroll
Det fysiska mötet är ett regulatoriskt krav
En lista över anslutna ombud finns i appen
UTFORSKA MED FREJA

Utforska-fliken i Freja innehåller senaste nyheterna och utvecklingarna kopplade till Freja, digital säkerhet och tech. Se vilka tjänster som är populära och vilka vi rekommenderar dig testa! Det finns alltid något intressant att läsa och upptäcka i Utforska.

SÄKERHET, REGELEFTERLEVNAD, TILLIT

Freja var den första statligt godkända mobila e-legitimationen i Sverige. Freja följer all rådande Svensk och EU lagstiftning kring data-hantering och integritet. Freja är även Sveriges godkända lösning för eIDAS.

---------------------------------

Behöver du hjälp med att komma igång? Vi finns här för dig! Besök www.frejaeid.com eller skriv till oss på support@frejaeid.com så hjälper vi dig.
